function Home() {
  return (
    <div>
      <Navbar />
      <HeroSection />
      <h1>Recommended</h1>
      <ProjectSlider />
      <h1>Top Trending</h1>
      <ProjectSlider />
      <h1>Recently Viewed</h1>
      <ProjectSlider />
    </div>
  );
}

export default Home;
